import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
    return ( 
        <div>
            <div className="navbar">
        <div className="logo">Courses Webpage</div>
       <Link to="/login" > <div class="box-1">
  <div class="btn btn-one">
    <span>HOVER ME</span>
  </div>
</div></Link>
      </div>
        </div>
     );
}
 
export default Navbar;
